function PostsCards() {
  const [posts, setPosts] = useState([]);
  const myHeaders = new Headers();
myHeaders.append("Content-Type","application/json" );
myHeaders.append("api_key","blt19d69e3984ff963a" );
myHeaders.append("delivery_token","cs42701f5dfb9cd8f0636dff0a" );
  const fetchPost = async () => {
    const response = await fetch(
      "https://cdn.contentstack.io/v3/content_types/hd_food_blog/entries?environment=hd-prod", {
      method: "GET",
      "Content-Type": "application/json",
      api_key: "blt19d69e3984ff963a",
      access_token: "cs42701f5dfb9cd8f0636dff0a",
    }
    );
    const data = await response.json();
    setPosts(data);
  };

  useEffect(() => {
    fetchPost();
  }, []);
  return (
    <div className="App">
      <p> {posts.title} </p>
      <button onClick={fetchPost}> get new joke </button>
    </div>
  );
}
export default PostsCards;

